import React from "react";

interface VideoThumbnailProps{
    imageSrc: string;
    channelName: string;
    category:string;
}
export default function VideoThumbnail({imageSrc,channelName,category}: VideoThumbnailProps) {

    return (<>
        <img src={imageSrc} alt='imageThumbnail' className="w-100 rounded"/>
        <p className="fs-4">{channelName}</p>
        <p className="fs-6">{category}</p>
      </>)
}
